export default () => {
    return (
        <div className="text-center">
            <div className="rounded-circle">
                <img src={imgUser} />
            </div>
            <div>
                <h4>Joana Sousa</h4>
                <p> <FaMapMarkerAlt /> From <b> Aveiro, Portugal</b></p>
                <p> Buddy since 2018 </p>
                <Button> <FaEdit /> Edit Information</Button>
            </div>


        </div>
    )

}
